// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// Event in solidity
// -> external communication
// -> takes cheap storage
// -> can search data by indexing


contract Event{
    event Log(address indexed sender, string message);

    function showEvent() public {
        emit Log(msg.sender, "Helly Martian");
        emit Log(msg.sender, "Welcome to Proxima Centurai");
    }


}

